	add("smaragd", "{\"term\":\"smaragd\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Hebrew\", \"Latin\", \"Sanskrit\"], \"text\":\"From Latin \u0027smaragdus\u0027 from Ancient greek (to 1453) \u0027σμάραγδος\u0027 \u0027μάραγδος\u0027 from Semitic root b-r-q “to shoot lightning, to flash in darkness”, compare Hebrew \u0027בָּרֶקֶת\u0027 (emerald, flashing gem) Akkadian \u0027\u0027 (tr\u003dbarruktu) Sanskrit \u0027मरकत\u0027 from Semitic.Persian \u0027zumrud\u0027 (whence Turkish zümrüd, whence Russian \u0027изумруд\u0027 from Ancient Greek. {{attention|en|is this an alternative etymology?}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An emerald\", \"priority\":1}]}, \"synonyms\":{}}");

	add("smaragdine", "{\"term\":\"smaragdine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027smaragdinus\u0027 from Ancient greek (to 1453) \u0027σμάραγδινος\u0027 from \u0027σμάραγδος\u0027 See \u0027\u0027 for more.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Emerald\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1814\u0027\u0027, w:Diodorus Diodorus Siculus, G. Booth (translator), \u0027The Historical Library of Diodorus the Sicilian\u0027, Volume 1, [http://books.google.com.au/books?id\u003doysUAAAAYAAJ\u0026amp;pg\u003dPA143\u0026amp;dq\u003d%22smaragdine%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKxEDUfD3JseciAfrn4HIAw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22smaragdine%22\u0026amp;f\u003dfalse page 143\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027smaragdine\u0027\u0027 and beryl, (as they are called), which are found in the copper-mines, are said to have their colour from their mixture with sulphur: and that the chrysolite, produced by the heat of thesun, receives its tincture from a hot and fiery exhalation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1833\u0027\u0027, John Brown, \u0027Stones\u0027, entry in \u0027A Dictionary of the Holy Bible\u0027, [http://books.google.com.au/books?id\u003dd6xbAAAAMAAJ\u0026amp;pg\u003dPA484\u0026amp;dq\u003d%22smaragdine%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKxEDUfD3JseciAfrn4HIAw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22smaragdine%22\u0026amp;f\u003dfalse page 484\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"others green, as the emerald, \u0027\u0027smaragdine\u0027\u0027, and beryl; others bluish, as the sapphire and turquois; others purple-coloured, as the amethyst\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, H. Stanley Redgrove, \u0027Alchemy Ancient and Modern\u0027, Facsimile Reprint, [http://books.google.com.au/books?id\u003dg7F7H4dqJAUC\u0026amp;pg\u003dPA29-IA7\u0026amp;dq\u003d%22smaragdine%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKxEDUfD3JseciAfrn4HIAw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22smaragdine%22\u0026amp;f\u003dfalse page 40\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In a work attributed to Albertus Magnus, but which is probably spurious, we are told that Alexander the Great found the tomb of Hermes in a cave near Hebron. This tomb contained an emerald table — “The \u0027\u0027Smaragdine\u0027\u0027 Table″ — on which were inscribed the following thirteen sentences in Phœnician characters: —\", \"priority\":10}]}, \"synonyms\":{}}");

